import React from 'react';
import { Link } from 'react-router-dom'; // Asegúrate de tener esta dependencia instalada

const Header = () => {
  return (
    <header>
      <div>
        <h1>Bienvenidos a las plantas de Juan</h1> {/* Mensaje de bienvenida */}
      </div>
      <nav>
        <Link to="/">Inicio</Link>
        <Link to="/productos">Productos</Link>
        <Link to="/carrito">Carrito</Link>
      </nav>
      {/* Elimina el siguiente div si no quieres mostrar el conteo del carrito */}
      {/* <div>
        <span>0</span> {/* Conteo de artículos en el carrito */}
      {/* </div> */}
    </header>
  );
};

export default Header;
